DROP TABLE IF EXISTS `sys_area`;
CREATE TABLE `sys_area` (
  `id` varchar(64) NOT NULL COMMENT '区域编号',
  `parent_id` varchar(64) DEFAULT NULL COMMENT '父级编号',
  `parent_ids` text COMMENT '所有父级编号',
  `name` varchar(200) NOT NULL COMMENT '名称',
  `sort` decimal(10,0) NOT NULL DEFAULT '1' COMMENT '排序',
  `area_code` varchar(100) DEFAULT NULL COMMENT '区域编码',
  `area_type` char(1) DEFAULT NULL COMMENT '区域类型',
  `short_name` varchar(200) DEFAULT NULL COMMENT '区域简称',
  `city_code` varchar(50) DEFAULT NULL COMMENT '城市代码',
  `zip_code` varchar(50) DEFAULT NULL COMMENT '邮政编码',
  `merger_name` varchar(200) DEFAULT NULL COMMENT '区域全称',
  `lng` varchar(50) DEFAULT NULL COMMENT '经度',
  `lat` varchar(50) DEFAULT NULL COMMENT '纬度',
  `pinyin` varchar(100) DEFAULT NULL COMMENT '汉语拼音',
  `first_char` varchar(50) DEFAULT NULL COMMENT '拼音首字母',
  `short_hand` varchar(50) DEFAULT NULL COMMENT '拼音简称',
  `create_by` varchar(64) NOT NULL COMMENT '创建者',
  `create_date` datetime NOT NULL COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT NULL COMMENT '更新者',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注信息',
  `del_flag` int(11) NOT NULL DEFAULT '1' COMMENT '删除标记',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`),
  KEY `sys_area_parent_id` (`parent_id`),
  KEY `sys_area_del_flag` (`del_flag`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='区域表';

